import AddImage from '../Image/addimage.png';
import AddDescription from '../Image/adddescription.png';
import AddYourProduct from '../Image/addyourproduct.png';

export default class AddMedia extends Component {

  render() {
    return (
      <div style={{  width: '250px',
        height: '224px'
       }}>

       <Card>
       <ListGroup>
        <ListGroupItem>Add Media</ListGroupItem>

        <ListGroupItem>
        <Media>
      <Media left href="#">
        <CardImg src={AddImage}  />
      </Media>
      <Media body>
        <Media heading>
        Add Image
        </Media>

        </Media>
        </ Media>
        </ListGroupItem>
        <ListGroupItem>Morbi leo risus</ListGroupItem>
        <ListGroupItem>Porta ac consectetur ac</ListGroupItem>
        <ListGroupItem>Vestibulum at eros</ListGroupItem>
      </ListGroup>
       </Card>
       </div>
    )
  }
}
